  gap: 0;
  grid-template-columns: 1fr;
  grid-template-rows: 1fr 1fr;
  gap: 32px;
  justify-content: initial;
  justify-items: initial;
  align-items: initial;
}
@media screen and (min-width: 768px) {
  .day-40 {
    display: grid;
    gap: 0;
    grid-template-columns: 1fr 1fr;
    grid-template-rows: 1fr;
    gap: 32px;
    justify-content: initial;
    justify-items: initial;
    align-items: initial;
  }
}
.day-40-bg {
  background: #ffc2e1;
  background: linear-gradient(333deg, #ffc2e1 0%, #ffe8f0 100%);
}
.day-40-col {
  background-color: #f8f9fa;
  background-color: var(--white);
  box-shadow: 0px 10px 15px -7px rgba(94, 24, 36, 0.26);
}
.day-40-menu {
  position: relative;
  display: flex;
  flex-direction: row;
  justify-content: center;
  flex-wrap: wrap;
  padding: 8px;
}
.day-40-arrow {
  position: absolute;
  left: 10%;
  top: 50%;
  transform: translateY(-50%);
}
.day-40-stars {
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  flex-wrap: wrap;
  color: orange;
  color: var(--orange);
  width: 200px;
}
.day-40-body {
  padding: 16px;
  padding-top: 32px;
  padding-bottom: 32px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  flex-wrap: wrap;
}
.day-40-body > *:not(:first-child) {
  margin-top: 16px;
}
.day-40-body > *:not(:last-child) {
  margin-bottom: 16px;
}
.day-40-pic {
  margin-right: 32px;
  margin-left: 32px;
  height: 300px;
  background-color: #ff8da1;
  background-color: var(--pink-dark);
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  flex-wrap: wrap;
}
.day-40-like {
  font-size: 20px;
  height: 2.5em;
  line-height: 2.5em;
  width: 2.5em;
  text-align: center;
  background-color: #ff8da1;
  background-color: var(--pink-dark);
  color: #f8f9fa;
  color: var(--light);
  border-radius: 50%;
  position: absolute;
  right: 5px;
  bottom: 5px;
}

.card-hover-body {
  transition: transform 0.3s 0.3s ease-in-out;
  background: black;
  background: linear-gradient(0deg, rgba(0, 0, 0, 0.7) 0%, rgba(0, 0, 0, 0) 100%);
  transform: translateY(77%);
  transform-origin: top;
  will-change: transform;
}
.card-hover:hover > .card-hover-body {
  transform: translateY(0);
}
.card-hover-line {
  transform: scaleX(0);
  width: 80%;
  transition: transform 0.3s ease-in-out;
  transform-origin: left;
  will-change: transform;
}
.card-hover:hover .card-hover-line {
  transform: scaleX(1);
}
.card-hover > img {
  transform: scale(1);
  transition: transform 0.3s 0.3s ease-in-out;
  will-change: transform;
}
.card-hover:hover > img {
  transform: scale(1.2);
}

input, select {
  padding: 8px;
}

