  $num: 1;
  @each $key, $value in $breakpoints {
    @include prop-size(-#{$key}, margin Div($margin, $num));
    @include prop-size(l-#{$key}, margin-left $margin * $num);
    @include prop-size(r-#{$key}, margin-right $margin * $num);
